import React from 'react'

const Work1 = () => {
  const sectionStyle = {
    background: '#f5f5f5',
    padding: '40px 0',
  };

  const headingStyle = {
    textAlign: 'center',
    marginBottom: '20px',
  };

  const imageWrapperStyle = {
    marginBottom: '20px',
  };
  return (
    <section className="our-clients" style={sectionStyle}>
    <div className="container">
      <h2 className="text-center" style={headingStyle}>Our Work</h2>
      <div className="row">
        {/* Add the image elements and their respective styles */}
      </div>
      {/* Add the remaining rows */}
    </div>
  </section>
  )
}

export default Work1
